import React from 'react'

const TodoForm = ({ addTask, task, setTask }) => {
  console.log(task)
  return (
    <form>
      <input
        type="text"
        value={task}
        onChange={setTask}
        placeholder="Napište úkol"
      />
      <button type="button" onClick={() => addTask(task)}>
        Přidat úkol
      </button>
    </form>
  )
}

export default TodoForm
